  static get is() {
    return 'sh-patient-illustration';
  }
  static get properties() {
    return {
      active: {
        type: String,
        observer: '_activeChanged',
        reflectToAttribute: true,
        notify: true
      },
      disabled: {
        type: Array,
        observer: '_disabledChanged',
        reflectToAttribute: true,
        notify: true
      },
      image: {
        type: String,
        value: 'ct_adult_anatomical',
        observer: '_queryImage',
        reflectToAttribute: true,
        notify: true
      }
    }
  }

  ready() {
    //simpler version:
    let deviceArray = ['iOS', 'Android', 'iPad', 'iPhone'];
    let clickEvent = 'click';
    let startHoverEvent = 'mouseenter';
    let endHoverEvent = 'mouseleave';
    let interaction = "click";
    deviceArray.forEach(element => {
      if (navigator.userAgent.includes(element)) {
        clickEvent = startHoverEvent = endHoverEvent = 'touchend';
        interaction = "touch";
      
      }
    });
    super.ready();
    let _this, regions;
    _this = this;
    regions = this.shadowRoot.querySelectorAll('.region');
    for (let i = 0; i < regions.length; i++) {
      regions[i].addEventListener(clickEvent, function (e) {
        e.preventDefault();
        if (_this.active !== e.target.getAttribute('index')) {
          _this.active = e.target.getAttribute('index');
        } else {
          _this.active = undefined;
        }
      })
      if(interaction == "click") {
        regions[i].addEventListener(startHoverEvent, function (e) {
          let hoverRegion = e.target.getAttribute('index');
          for (let x = 0; x < regions.length; x++) {
            if (regions[x].getAttribute('index') === hoverRegion) {
              regions[x].setAttribute('hover', true);
            }
          }
          e.target.addEventListener(endHoverEvent, function () {
            for (let x = 0; x < regions.length; x++) {
              regions[x].removeAttribute('hover');
            }
          })
        })
      }
    }
  }

  _activeChanged() {
    let regions;
    regions = this.shadowRoot.querySelectorAll('.region');
    for (let i = 0; i < regions.length; i++) {
      if (regions[i].getAttribute('index') === this.active) {
        regions[i].setAttribute('active', true);
      } else {
        regions[i].removeAttribute('active');
      }
    }
  }

  _disabledChanged() {
    let regions;
    regions = this.shadowRoot.querySelectorAll('.region')
    for (let i = 0; i < regions.length; i++) {
      if (this.disabled.indexOf(regions[i].getAttribute('index')) >= 0) {
        regions[i].setAttribute('disabled', true);
      } else {
        regions[i].removeAttribute('disabled');
      }
    }
  }

  _queryImage() {
    let svgs;
    svgs = this.shadowRoot.querySelectorAll('svg');
    for (let i = 0; i < svgs.length; i++) {
      if (svgs[i].id === this.image) {
        svgs[i].removeAttribute('hidden');
      } else {
        svgs[i].setAttribute('hidden', true);
      }
    }
  }
